import React from 'react';
import { Phone } from 'lucide-react';

const Contacts = () => {
  const contacts = [
    { name: 'Tino', sip: '701', img: './images/tino.png' },
    { name: 'Sarath', sip: '702', img: '/images/sarath.png' },
    { name: 'John', sip: '703', img: '/images/john.png' },
    { name: 'Vikaas', sip: '704', img: '/images/vikaas.png' },
    { name: 'Dharshu', sip: '705', img: '/images/dharshu.png' },
    { name: 'Mathi', sip: '706', img: '/images/mathi.png' },
    { name: 'Sridhar', sip: '707', img: '/images/sridhar.png' },
    { name: 'Nandhini', sip: '708', img: '/images/nandhini.png' },
    { name: 'Raagini', sip: '709', img: '/images/raagini.png' },
  ];

  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
      {contacts.map((contact) => (
        <div
          key={contact.sip}
          className="flex flex-col items-center bg-white p-4 rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300 border border-gray-200"
        >
          <img
            src={contact.img}
            alt={contact.name}
            className="w-20 h-20 rounded-full object-cover border-2 border-blue-500 mb-3"
          />
          <h3 className="text-lg font-semibold text-gray-800">{contact.name}</h3>
          <p className="text-sm text-gray-500 mb-3">SIP: {contact.sip}</p>
          <button
            className="flex items-center justify-center bg-green-500 text-white px-4 py-2 rounded-full hover:bg-green-600 transition-colors duration-300"
          >
            <Phone size={16} className="mr-2" />
            Call
          </button>
        </div>
      ))}
    </div>
  );
};

export default Contacts;
